namespace GBWorldGen.Core.Voos
{
    public class VoosGenerator
    {
        private readonly string _fileData = "";
        private readonly string _templateKey = "{{{ENCODED_MAP_DATA}}}";
        private readonly string _mapWidth = "{{{MAP_WIDTH}}}";
        private readonly string _mapLength = "{{{MAP_LENGTH}}}";
        private readonly Serializer _serializer = new Serializer();

        public VoosGenerator()
        {
            _fileData = SampleVoosFile();
        }

        public string Generate(Map map, string outputDirectory = null, string mapName = null, string mapDescription = null)
        {
            string encodedMapData = _serializer.Serialize(map);

            string parentFolderName = $"WorldGen-{RandomStringGenerator.Generate(32)}";
            string parentFolderPath = Path.Combine(
                !string.IsNullOrEmpty(outputDirectory) ? outputDirectory : Directory.GetCurrentDirectory(), parentFolderName);

            string voosFileData = _fileData.Replace(_templateKey, encodedMapData);
            voosFileData = voosFileData.Replace(_mapWidth, map.VoosWidth.ToString());
            voosFileData = voosFileData.Replace(_mapLength, map.VoosLength.ToString());
            string voosFilePath = Path.Combine(parentFolderPath, "scene.voos");
            string metadataFilePath = Path.Combine(parentFolderPath, "metadata.json");
            string thumbnailFilePath = Path.Combine(parentFolderPath, "thumbnail.png");

            // Write parent folder
            Directory.CreateDirectory(parentFolderPath);

            // Write sub-files
            using (StreamWriter streamWriter = new StreamWriter(voosFilePath))
                streamWriter.Write(voosFileData);

            using (StreamWriter streamWriter = new StreamWriter(metadataFilePath))
                streamWriter.Write(SampleMetadataFile(mapName, mapDescription));

            // get thumbnail image working eventually
            //using (StreamWriter streamWriter = new StreamWriter(thumbnailFilePath))
            //    streamWriter.Write(SampleThumbnail());
            
            return voosFilePath;
        }

